import React from "react";
import { ContentDiv } from "../styledComponents";
import Test_1 from "../img/Test_1.jpeg";

const Content = () => {
  return (
    <ContentDiv className="contentWrapper">
      <div>
        <img src={Test_1} alt="Test_1"></img>
        <div className="buttonWrapper">
          <button className="option1"></button>
          <button className="option2"></button>
        </div>
      </div>
    </ContentDiv>
  );
};

export default Content;
